Option is another enum defined by the standard library. Null: billion-dollar mistake. Rust does not have nulls, but it does have an enum that can encode the concept of a value being present or absent. This enum is Option, and it is defined by the standard library as follows: #![allow(unused)]
fn main() { enum Option<T> { None, Some(T), }
} The Option<T> enum is so useful that it's even included in the prelude; you don't need to bring it into scope explicitly. In addition, so are its variants: you can use Some and None directly without the Option:: prefix. The <T> syntax: generic type parameter. <T> means the Some variant of the Option enum can hold one piece of data of any type. Here are some examples of using Option values to hold number types and string types: fn main() { let some_number = Some(5); let some_string = Some("a string"); let absent_number: Option<i32> = None; // if we use None rather than Some, // we need to tell Rust what type of Option<T> we have // because the compiler can't infer the type, // that the `Some` variant will hold by looking only at a `None` value.
} When we have a Some value, we know that a value is present and the value is held within the Some. When we have a None value, in some sense, it means the same thing as null: we don't have a valid value. We can proceed confidently without having to check for null before using that value. You have to convert an Option<T> to a T before you can perform T operations with it. Generally, this helps catch one of the most common issues with null: assuming that something isn't null when it actually is.

