The if let syntax lets you combine if and let into a less verbose way to handle values that match one pattern while ignoring the rest. fn main() { let some_u8_value = Some(0u8); match some_u8_value { Some(3) => println!("three"), _ => (), }
} The following code behaves the same: fn main() { let some_u8_value = Some(0u8); if let Some(3) = some_u8_value { println!("three"); }
} The syntax if let takes a pattern and an expression separated by an equal sign. It works the same way as a match, where the expression is given to the match and the pattern is its first arm. Using if let means less typing, less indentation, and less boilerplate code. However, you lose the exhaustive checking that match enforces. Choosing between match and if let depends on what you’re doing in your particular situation and whether gaining conciseness is an appropriate trade-off for losing exhaustive checking. In other words, you can think of if let as syntax sugar for a match that runs code when the value matches one pattern and then ignores all other values. We can include an else with an if let. #[derive(Debug)]
enum UsState { Alabama, Alaska, // --snip--
} enum Coin { Penny, Nickel, Dime, Quarter(UsState),
} fn main() { let coin = Coin::Penny; let mut count = 0; match coin { Coin::Quarter(state) => println!("State quarter from {:?}!", state), _ => count += 1, }
} #[derive(Debug)]
enum UsState { Alabama, Alaska, // --snip--
} enum Coin { Penny, Nickel, Dime, Quarter(UsState),
} fn main() { let coin = Coin::Penny; let mut count = 0; if let Coin::Quarter(state) = coin { println!("State quarter from {:?}!", state); } else { count += 1; }
} They are the same.
